import React, {useState, useEffect} from 'react'
import  './App.css'

const words = 'Hello World'

function App() {
    const [typedWord, setTypedWord] = useState('')

    useEffect(() => {
      const wordtyper = setTimeout(() => {
         setTypedWord(words)
       }, 10);

       return () => clearTimeout(wordtyper.slice(0, ))
    }, [])


  return (
    <div>
      <h1 className="typing">{typedWord}</h1>
    </div>
  )
}

export default App
